s\":{\"text\":\"<p>Diferentemente das células de animais e outros eucariontes, as células de bactérias não possuem núcleo celular e raramente possuem organelos separados por membranas.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sem título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"496c790c-3b5e-47fc-8b69-fbade2447a6e\"}]},{\"position\":{\"x\":70.8,\"y\":12.087133520419467},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Na biologia, chama-se pluricelular, a um organismo formado por mais do que uma célula. São seres constituídos por diversas células com diferentes funções e que tem diferenciação entre elas, fazendo assim com que seja capaz de formar tecidos.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sem título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"e1ac27fb-24ee-42a5-8b67-8baf204f96d8\"}]},{\"position\":{\"x\":7.199999999999999,\"y\":70.14287626467764},\"alwaysFullscreen\":false,\"content\":[{\"params\":{\"text\":\"<p>Animais e plantas são exemplos de organismos pluricelulares. </p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Texto\",\"license\":\"U\",\"title\":\"Sem título Texto\",\"authors\":[],\"changes\":[]},\"subContentId\":\"1670888e-3285-4f85-80fe-de082962fcc8\"}]}],\"hotspotNumberLabel\":\"Hotspot #num\",\"closeButtonLabel\":\"Fechar\",\"disableScaling\":false,\"image\":{\"path\":\"data:image/jpeg;base64,/9j/4AAQSkZJRgABAgAAAQABAAD/2wBDAAIBAQEBAQIBAQECAgICAgQDAgICAgUEBAMEBgUGBgYFBgYGBwkIBgcJBwYGCAsICQoKCgoKBggLDAsKDAkKCgr/2wBDAQICAgICAgUDAwUKBwYHCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgr/wAARCAFCAwsDABEAAREBAhEB/8QAHwAAAQUBAQEBAQEAAAAAAAAAAAECAwQFBgcICQoL/8QAtRAAAgEDAwIEAwUFBAQAAAF9AQIDAAQRBRIhMUEGE1FhByJxFDKBkaEII0KxwRVS0fAkM2JyggkKFhcYGRolJicoKSo0NTY3ODk6Q0RFRkdISUpTVFVWV1hZWmNkZWZnaGlqc3R1dnd4eXqDhIWGh4iJipKTlJWWl5iZmqKjpKWmp6
